import * as api from '../api';

export const getDiariesAction = () => async (dispatch) =>{
    try{

        const {data} = await api.getDiariesApi();
        dispatch ({type: 'GET_ALL', payload: data});

    } catch(error) {
        console.log(error.message);
    }
}

export const postDiariesAction = () => async (dispatch) =>{
    try{

        const {data} = await api.postDiariesApi();
        dispatch ({type: 'POST', payload: data});

    } catch(error) {
        console.log(error);
    }
}
